import React from 'react';
import './contact.css';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../../common/sectionHeader/sectionHeader.js';

function contact() {
    return (
        <section className = "contact" id = "contact">
            <Container>
                <Header effectType = "fade-up" headerText = "Contact" contentText = "Having trouble using our solution. Contact us to let us know"></Header>
                <Row>
                    <Col lg = {2}>
                    
                    </Col>
                    <Col lg = {2}>
                    
                    </Col>
                    <Col lg = {2}>
                    
                    </Col>
                </Row>
                
            </Container> 
        </section>
    )
}

export default contact
